import React from "react";
import "./GoalForm.css";
const GoalFrom = () => {
  return (
    <div className="goalForm">
      <h3 className="goalForm">Your Goals</h3>
      <input type="text" />
      <br />
      <button>Add Goal</button>
    </div>
  );
};

export default GoalFrom;
